<!DOCTYPE html>
<html>
<head>
  <title>G-Drive Auth - SkyMirror</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    body {
      margin: 0;
      background-color: black;
      color: white;
      font-family: Arial, sans-serif;
    }
    
    .component {
      margin: 20px auto;
      max-width: 300px;
      width: 90%;
      padding: 20px;
      background-color: rgba(255, 255, 255, 0.1);
      border-radius: 10px;
    }
    
    .component h2 {
      margin-bottom: 10px;
      text-align: center;
    }
    
    .content {
      margin-top: 20px;
      text-align: center;
    }
    
    .content span {
      display: block;
      margin-bottom: 10px;
    }
    
    .content textarea {
      display: none;
      resize: none;
      width: 100%;
      height: 100px;
      padding: 10px;
      box-sizing: border-box;
      text-align: center;
      border: none;
      outline: none; /* Menghilangkan garis merah dan penyorotan biru */
      border-radius: 5px;
      background-color: rgba(255, 255, 255, 0.1);
      color: white;
      font-size: 16px;
    }
    
    .content button {
      display: none;
      width: 150px;
      height: 40px;
      margin-top: 10px;
      background-color: pink;
      color: white;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      font-size: 16px;
      text-align: center;
      margin-left: auto;
      margin-right: auto;
      display: block;
    }
    
    footer {
      text-align: center;
      margin-top: 20px;
      padding: 10px;
    }
    
    @media (min-width: 768px) {
      .component {
        max-width: 500px;
      }
    }
  </style>
</head>
<body>
  <div class="component">
    <h2 id="authStatus">Authentication Code:</h2>
    <div class="content">
      <span id="info"></span>
      <textarea id="generatedauth"></textarea>
      <button id="copas">Copy</button>
    </div>
  </div>

  <footer>&copy; 2023 SkyMirror</footer>

      });

      copyButton.style.display = 'none';
